import { useParams } from "react-router-dom";
import Navbar from "../Navbar";
import Side from "../Side";
import Sidebar from "../Sidebar";
import { useEffect, useState } from "react";
import AuthorChannel from "./AuthorChannel";
import { NavLink } from "react-router-dom";
// import thumbnail from '../../assets/thumbnail.webp';
import { Helmet } from "react-helmet";

export default function AuthorChannelChannels({ userInfo, subdata }){
    const [authorInfo, setAuthorInfo] = useState([]);
    const [videos, setVideos] = useState([]);
    const [subscribers, setSubscribers] = useState([]);
    const { authorslug } = useParams();
    const authorslu = authorslug.replace('@', '');

    const onDataReceivedFromChild = (data) => {
        setAuthorInfo(data.author_data[0]);
        setVideos(data.videos_data);
        setSubscribers(data.subscriber_channels);
    }

    useEffect(() => {

    }, [authorslu, videos])

    return (
        <>
            <Helmet>
                {authorInfo.channelname ? (
                    <title>{`${authorInfo.channelname} - YouTube`}</title>
                ):(
                    <title>YouTube</title>
                )}
            </Helmet>
            <Navbar userInfo={userInfo} />
            <div className="main">
                <Side />
                <Sidebar subdata={subdata} />
                <div className="main-scroll">
                    <div className="channellayer">
                        <AuthorChannel userInfo={userInfo} authorslug={authorslu} onDataReceived={onDataReceivedFromChild} />
                        <div className="channelvideoscon">
                            <div className="channelvideoscon-inner">
                                {subscribers.length <= 5 ? (
                                    <>
                                        {subscribers.map((sub) => (
                                            <div className="channelvid" key={sub.id}>
                                                <div className="channelvid-img">
                                                    <div className="channel-img">
                                                        <NavLink to={`/@${sub.slug}`}>
                                                            <img alt={sub.id} src={sub.image ? sub.image : author} />
                                                        </NavLink>
                                                    </div>
                                                </div>
                                                <div className="channelvid-detail">
                                                    <div className="channelvid-detail-inner">
                                                        <h3>{sub.name}</h3>
                                                        <label>{sub.subs} Subscribers</label>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                    </>
                                ):(
                                    <>
                                        {subscribers.map((sub) => (
                                            <div className="channelvid" key={sub.id}>
                                                <div className="channelvid-img">
                                                    <div className="channel-img">
                                                        <NavLink to={`/@${sub.slug}`}>
                                                            <img alt={sub.id} src={sub.image ? sub.image : author} />
                                                        </NavLink>
                                                    </div>
                                                </div>
                                                <div className="channelvid-detail">
                                                    <div className="channelvid-detail-inner">
                                                        <h3>{sub.name}</h3>
                                                        <label>0 Subscribers</label>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                    </>
                                )}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
